import React, { useState } from 'react';
import { Link } from "react-router-dom";
import Logo from './img/Logo.png';

const TeamMember = ({ name, jobTitle, specialization, imageUrl }) => {
  return (
    <div className="flex flex-col items-center space-y-4 mb-42"> {/* Center items and increase space between them */}
      <img src={imageUrl} alt={name} className="" />
      <div className="text-center">
        <h3 className="text-lg font-semibold">{name}</h3>
        <p className="text-sm">{jobTitle}</p>
        <p className="text-sm">{specialization}</p>
      </div>
    </div>
  );
};

const Create = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  const teamMembers = [
    {
      name: 'Mohamed Hesham',
      jobTitle: 'Web Developer',
      specialization: 'backend',
      imageUrl: 'Logo.png',
    },{
      name: 'HAssan Tarek',
      jobTitle: 'Web Developer',
      specialization: 'Frontend',
      imageUrl: 'Logo.png',
    },{
      name: 'Mena Sabry',
      jobTitle: 'Web Developer',
      specialization: 'Frontend',
      imageUrl: 'Logo.png',
    },{
      name: 'Yousef shapan',
      jobTitle: 'Web Developer',
      specialization: 'Frontend',
      imageUrl: 'Logo.png',
    },{
      name: 'reem Ibrhim',
      jobTitle: 'Web Developer',
      specialization: 'Frontend',
      imageUrl: 'Logo.png',
    },{
      name: 'Aya goda',
      jobTitle: 'Web Developer',
      specialization: 'Frontend',
      imageUrl: 'Logo.png',
    },
    
  ];

  const chunkedTeamMembers = teamMembers.reduce((result, item, index) => {
    const chunkIndex = Math.floor(index / 3);

    if (!result[chunkIndex]) {
      result[chunkIndex] = [];
    }

    result[chunkIndex].push(item);

    return result;
  }, []);

  return (
    <>
      <nav className="bg-purple-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10">
        <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
          <div className="flex justify-between items-center w-full md:w-auto">
            <img className="object-cover" src={Logo} alt="Profile" />
            <button
              onClick={toggleDropdown}
              className="md:hidden text-yellow-500 hover:text-orange-600 focus:outline-none"
            >
              ☰
            </button>
          </div>
          <ul className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${isOpen ? 'block' : 'hidden'}`}>
            <li><Link to="/home" className="text-white m-2 hover:text-orange-600 font-blond text-lg">Home</Link></li>
            <li><Link to="/profile" className="text-white hover:text-orange-600 m-2 font-blond text-lg">Profile</Link></li>
            <li><Link to="/about" className="text-white hover:text-orange-600 m-2 font-blond text-lg">About</Link></li>
            <li><Link to="/contact" className="text-white hover:text-orange-600 m-2 font-blond text-lg">Contact</Link></li>
          </ul>
        </div>
      </nav>

      <div className=" mt-24">
        <div className=" pb-28">
          <h1 className="text-3xl font-bold tracking-tighter sm:text-5xl pb-4"> Team members</h1>
          <div className="flex flex-col  space-y-2  ">
            {/* Render team members in rows */}
            {chunkedTeamMembers.map((chunk, index) => (
  <div key={index} className="flex flex-wrap justify-center space-x-4 space-y-8 md:space-y-0 ml-10">
    {chunk.map((member, i) => (
      <TeamMember key={i} {...member} />
    ))}
  </div>
))}
          </div>
        </div>
        <div className="p-28 pb-28">
          <h1 className="text-3xl font-bold tracking-tighter sm:text-5xl pb-4">We're on a mission to make the web beautiful</h1>
          <p className="mx-auto max-w-[600px] text-gray-500 md:text-xl/relaxed lg:text-base/relaxed xl:text-xl/relaxed dark:text-gray-400">
            At Acme Inc, we believe in the power of the web. We're dedicated to creating tools and resources that
            empower developers to build amazing experiences for the world.
          </p>
        </div>
        <div className="p-28 pb-28">
          <h2 className="text-2xl font-bold tracking-tighter sm:text-3xl">Our Values</h2>
          <p className="max-w-[700px] text-gray-500 md:text-xl/relaxed lg:text-base/relaxed xl:text-xl/relaxed dark:text-gray-400">
            We're committed to openness, inclusivity, and innovation. Our team is always looking for new ways to push
            the boundaries of what's possible on the web, and we're dedicated to sharing our knowledge and expertise
            with the community.
          </p>
        </div>
        <div className="p-28 pb-28">
          <h2 className="text-2xl font-bold tracking-tighter sm:text-3xl">Our History</h2>
          <p className="max-w-[700px] text-gray-500 md:text-xl/relaxed lg:text-base/relaxed xl:text-xl/relaxed dark:text-gray-400">
            Acme Inc was founded in 2015 by a group of passionate developers who wanted to make it easier for their
            peers to create beautiful and functional websites. Since then, we've grown into a global team of experts,
            and our mission remains the same: to provide the tools and resources that developers need to succeed.
          </p>
        </div>
      </div>
    </>
  );
};

export default Create;
